public class Solution {
    public int MinOperations(int[] nums) {
        Dictionary<int, int> countMap = new Dictionary<int, int>();
        foreach (int num in nums) {
            if (countMap.ContainsKey(num)) {
                countMap[num]++;
            } else {
                countMap[num] = 1;
            }
        }

        int operations = 0;
        foreach (var pair in countMap) {
            int freq = pair.Value;
            if (freq % 2 == 0) {
                operations += freq / 2;
            } else if (freq % 3 == 0) {
                operations += freq / 3;
            } else if ((freq - 2) % 3 == 0 && freq > 2) {
                operations += 1 + (freq - 2) / 3;
            } else {
                return -1;
            }
        }

        return operations;
    }
}
